import Meal from "./Meal";

const Category = ({ name, meals, products, setProducts }) => {
  return (
    <>
      <h3>{props.name}</h3>
      <div className="meals-container">
        {props.meals.map((meal, index) => {
          return (
            <Meal
              key={meal.id}
              {...meal}
              products={products}
              setProducts={setProducts}
            />
          ); //key={meal}
        })}
      </div>
    </>
  );
};

export default Category;
